<p id="mntl-sc-block_22-0" class="comp mntl-sc-block mntl-sc-block-html"> The steps are as follows: First, beat the yolks with a generous pinch of salt. Adding the salt early is important because you don't want to deflate the mixture later while trying to evenly distribute it into the beaten whites. You want to add a little more salt than it might seem like the yolks need, since you'll want enough to also season the whites.
</p>
